// src/App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Header from './Header';
import ProductList from './ProductList';
import Cart from './Cart';
import ProductDetails from './ProductDetails';
import './App.css';





const sampleProducts = [
  { id: 1, name: 'Product 1', price: 10, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'Electronics' },
  { id: 2, name: 'Product 2', price: 20, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'numeric' },
  { id: 3, name: 'Product 3', price: 10, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'Electronics' },
  { id: 4, name: 'Product 4', price: 20, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'numeric' },
  { id: 5, name: 'Product 5', price: 10, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'Electronics' },
  { id: 6, name: 'Product 6', price: 20, image: 'data:image/jpeg;base64,', description: 'GREAT PRODUCT TO INCLUDE NOW', category: 'numeric' },
];


const App = () => {
  const [cartItems, setCartItems] = useState([]);

  const addToCart = (product) => {
    setCartItems((prevItems) => {
      const existingItem = prevItems.find((item) => item.id === product.id);
      if (existingItem) {
        return prevItems.map((item) =>
          item.id === product.id ? { ...item, quantity: item.quantity + 1 } : item
        );
      } else {
        return [...prevItems, { ...product, quantity: 1 }];
      }
    });
  };

  const removeFromCart = (id) => {
    setCartItems((prevItems) => prevItems.filter((item) => item.id !== id));
  };

  return (
    <Router>
      <div>
        <Header />
        <Routes>
          <Route path="/" element={<h2>Welcome to our E-commerce Store!</h2>} />
          <Route
            path="/products"
            element={<ProductList products={sampleProducts} addToCart={addToCart} />}
          />
          <Route
            path="/cart"
            element={<Cart cartItems={cartItems} removeFromCart={removeFromCart} />}
          />
          <Route
  path="/product/:id"
  element={<ProductDetails products={sampleProducts} />}
/>
        </Routes>
      </div>
    </Router>
  );
};

export default App;
